$(document).ready(function () {

	/************** 全局	*************/
	// 针对ie a标签虚线问题
	(function(){

		// 如果是ie
		if(!!-[1,]){ return };
		var x, a = document.getElementsByTagName('a');
		for(x in a){
			a[x].hideFocus ="true";
		}
	})();


	// 加入收藏
	$('.js-setcollect').on('click',function(){
		var url = window.location.href;
		var title = document.title;
		try {
			window.external.addFavorite(url, title);
		}catch (e) {
			try {
				window.sidebar.addPanel(title, url, "");
			}catch (e) {
				alert("请使用Ctrl+D进行添加");
			}
		}
		return false;
	});

	// 设为首页
	$('.js-sethome').on('click',function(){

		try {
			document.body.style.behavior = 'url(#default#homepage)';
			document.body.setHomePage(window.location.href);
		} catch (e) {
			if (window.netscape) {
				try {
					netscape.security.PrivilegeManager.enablePrivilege("UniversalXPConnect");
				} catch (e) {
					alert("抱歉！您的浏览器不支持直接设为首页。请在浏览器地址栏输入'about:config'并回车然后将[signed.applets.codebase_principal_support]设置为'true'，点击'加入收藏'后忽略安全提示，即可设置成功。");
				}
			} else {
				alert('抱歉，您的浏览器不支持自动设置首页, 请使用浏览器菜单手动设置!');
			}
		}
	
		return false;
	});




	// 默认对话框
	window.loading = $('<div/>').appendTo($('body')).addClass('loading').html('<span><img src="/images/loading.gif"><br/></span>').on('click','b',function(){
		document.execCommand('stop');
	});
	window.dialog = $('<div/>').appendTo($('body')).addClass('dialog').dialog({width:'auto',height:'auto',autoOpen: false,modal: true,open: function( ) {
		loading.hide();
	}});
	
	//加载图标
	//$(document).on('submit','form',function(){
		//if(this.getAttribute('target') && this.getAttribute('target').toLowerCase() == '_blank') return ;
		//loading.show();
	//});
	

	// ajax 清缓存
	$.ajaxSetup({ cache: false }); 

	// 时间插件
	// f_tcalInit();


	//分页
	$('.ajaxpage').page();

	// 商户类型树实现
	$('.stors_type,.produ_type').on('click',function(){
		var the = $(this);
		loading.show();
		$.ajax({
			type: "POST",
			url: '/typeList.shtml',
			dataType: "json",
			success: function(json){
				loading.hide();
				if(!json.list) return;

				var trees = (function(tree,pid){

					var res = [];
					var nch = true;
					for (var i in tree) {
						if (tree[i].pid == pid) {
							var fuck = arguments.callee(tree, tree[i].id);
							if(fuck.length>0){
								res.push('<label>'+tree[i].name+'</label>')
							}else{
								res.push('<label><input type="radio" name="scope" value="'+tree[i].id+'"/>'+tree[i].name+'</label>')
							}
							
							res.push(fuck);
							nch = false;
						}
					}
					return (pid === 0 || nch) ? res.join('') : '<cite><i>+</i>' + res.join('\n') + '</cite>';

				})(json.list,0);


				dialog.html('<form class="stors_type_tree"><div class="stors_type_tree_cnt">'+trees+'</div><div class="stors_type_tree_submit"><input type="submit" value="确定"></div></form>')
				dialog.dialog("option","title", "选择商户类型").dialog('open');
				

				/* 文档树选择  */
				dialog.find('.stors_type_tree').on('click','label',function(e){

					var input = $(this).find('input[name="scope"]:checked');

					the.val(input.parent().text()).trigger('blur');
					the.closest('form').find('.produ_type_value').val(input.val());
					
				}).on('click','i',function(){
					var $this = $(this);

					if($this.html() === '+'){
						$this.html('-').parent('cite').children().not('i').css('display','block');

					}else{
						$this.html('+').parent('cite').children().not('i').css('display','none');
					}
				}).on('submit',function(){

					dialog.dialog('close');
					return false;
				});

				$this = null;
			}
		});
	});


	// 禁用表单自动填充
	$('form input[autocomplete="off"]').each(function () {
		var the = this;
		the.complete = the.getAttribute('name');
		the.removeAttribute('name');
		setTimeout(function () {
			the.setAttribute('name',the.complete);
			the = null;
		},100);
	});


});




//自动关闭提示框  
function Alert(str,callback) {  
    var msgw,msgh,bordercolor;  
    msgw=300;//提示窗口的宽度  
    msgh=80;//提示窗口的高度  
    titleheight=25 //提示窗口标题高度  
    bordercolor="#ee2323";//提示窗口的边框颜色  
    titlecolor="#99CCFF";//提示窗口的标题颜色  
    var sWidth,sHeight;  
    //获取当前窗口尺寸  
    sWidth = document.body.offsetWidth;  
    sHeight = document.body.offsetHeight;  
    
 
    //创建提示窗口的div  
    var msgObj = document.createElement("div") ; 
    msgObj.setAttribute("id","alertmsgDiv");  
    msgObj.setAttribute("align","center");  
    msgObj.style.background="white";  
    msgObj.style.border="1px solid " + bordercolor;  
    msgObj.style.position = "absolute";  
    msgObj.style.left = "50%";  
    msgObj.style.font="12px/1.6em Verdana, Geneva, Arial, Helvetica, sans-serif";  
    //窗口距离左侧和顶端的距离   
    msgObj.style.marginLeft = "-225px";  
    //窗口被卷去的高+（屏幕可用工作区高/2）-150  
    msgObj.style.top = document.body.scrollTop+(window.screen.availHeight/2)-150 +"px";  
    msgObj.style.width = msgw + "px";  
    msgObj.style.height = msgh + "px";  
    msgObj.style.textAlign = "center";  
    msgObj.style.lineHeight ="25px";  
    msgObj.style.zIndex = "10001";  
    document.body.appendChild(msgObj);  
    //提示信息标题  
    var title=document.createElement("h4");  
    title.setAttribute("id","alertmsgTitle");  
    title.setAttribute("align","left");  
    title.style.margin="0";  
    title.style.padding="3px";  
    title.style.background = bordercolor;  
    title.style.filter="progid:DXImageTransform.Microsoft.Alpha(startX=20, startY=20, finishX=100, finishY=100,style=1,opacity=75,finishOpacity=100);";  
    title.style.opacity="0.75";  
    title.style.border="1px solid " + bordercolor;  
    title.style.height="18px";  
    title.style.font="12px Verdana, Geneva, Arial, Helvetica, sans-serif";  
    title.style.color="white";  
    title.innerHTML="提示信息";  
    document.getElementById("alertmsgDiv").appendChild(title);  
    //提示信息  
    var txt = document.createElement("p");  
    txt.setAttribute("id","msgTxt");  
    txt.style.margin="16px 0";  
    txt.innerHTML = str;  
    document.getElementById("alertmsgDiv").appendChild(txt);  
    //设置关闭时间  
    window.setTimeout(function(){closewin(callback)},800);   
}  
function closewin(callback) {  
   
    document.getElementById("alertmsgDiv").removeChild(document.getElementById("alertmsgTitle"));  
    document.body.removeChild(document.getElementById("alertmsgDiv"));  
    
    callback && callback();
    
}  


/**************************幻灯片轮播效果*********************8***/

$(function(){
	var sWidth=$("#focus").width();
	var sHeight = $("#focus").height();
	var len=$("#focus ul li").length;
	var sWidth=$("#focus").width();
	var sm=$("<div class='sm'></div>")
	var index=0;
	var picTimer;
	var btn="<div class='btnBg'></div><div class='btn'>";
	for(var i=0;i<len; i++){
		var ii=i+1;
		btn +="<span>"+ii+"</span>";
		}
		$("#focus").append(btn);
		$("#focus").append(sm);
		$("#focus .btnBg").css("opacity",0.3);
		$("#focus .btn span").css("opacity",0.4).mouseenter(function(){
		index = $("#focus .btn span").index(this);
		sh(index);//向上滚动则改为showTop,向左滚动则改为showLeft,渐隐渐现则为sh
		}).eq(0).trigger("mouseenter");
		$("#focus").hover(function(){	   
				clearInterval(picTimer);
				},function(){
				picTimer=setInterval(function(){
						sh(index);//向上滚动则改为showTop,向左滚动则改为showLeft,渐隐渐现则为sh
						index++;
						if(index==len){index=0;}
						},2000);	//滚动间隔，数越大间隔越长
					}).trigger("mouseleave");
		
		
		function sh(index){
			$("#focus ul").css({"width":sWidth,"height":sHeight});
			var title=$("#focus img").eq(index).attr("title");
			$(".sm").empty();
			$(".sm").append(title);
			$("#focus ul li img").css({position:"absolute",top:0,left:0}).parent().eq(index).stop(true,true).animate({"opacity":1},2000).css({display:"block"}).siblings().stop(true,true).animate({"opacity":0.2},1000).css({display:"none"});
			$("#focus .btn span").stop(true,false).animate({"opacity":0.4},300).removeClass("red").eq(index).stop(true,false).animate({"opacity":0.8},300).addClass("red");
			}
		function showLeft(index){
			$("#focus ul").css("width",sWidth*len);
			var nowLeft=-index*sWidth;
			var title=$("#focus img").eq(index).attr("title");
			$("#focus .sm").empty();
			$("#focus .sm").append(title)
			$("#focus ul").stop(true,false).animate({"left":nowLeft},300);
			$("#focus .btn span").stop(true,false).animate({"opacity":0.4},300).removeClass("red").eq(index).stop(true,false).animate({"opacity":0.8},300).addClass("red");
			}
		function showTop(index) { 
			$("#focus ul").css("height",sHeight*len);
			var nowTop = -index*sHeight;
			var title=$("img").eq(index).attr("title")
			$(".sm").empty();
			$(".sm").append(title)
			$("#focus ul").stop(true,false).animate({"top":nowTop},300);
			$("#focus .btn span").stop(true,false).animate({"opacity":"0.4"},300).removeClass("red").eq(index).stop(true,false).animate({"opacity":"1"},300).addClass("red"); 
	}
});


/********返回顶部********/
(function() {

    var el = document.createElement('DIV');
    el.style.cssText = 'background-color:#999;width:50px;height:50px;position:fixed;left:50%;margin-left:520px; bottom:30px;border-radius:10px;cursor:pointer;display:none;';
    el.innerHTML = '<div style="height: 0;width: 0;border:14px solid #999999;border-top: 0 none;border-bottom:14px solid #fff;position: relative;margin:12px 0 0 11px;"><div style="width:8px;height:7px;position:absolute;top:14px;left:-4px;background-color:#fff;overflow: hidden;"></div></div>';
    document.body.appendChild(el);

    el.onclick = function() {
    	var top = getScrollTop();
        if (top > 0) {
            window.scrollTo(0, top / 1.2)
            setTimeout(arguments.callee, 10);
        }
    };

    el.onmouseover = function() {
        this.firstChild.style.borderBottom = '14px solid #ddd';
        this.firstChild.firstChild.style.backgroundColor = '#ddd';
    };

    el.onmouseout = function() {
        this.firstChild.style.borderBottom = '14px solid #fff';
        this.firstChild.firstChild.style.backgroundColor = '#fff';
    };


   
    function getScrollTop() {
        return ('pageYOffset' in window) ? window.pageYOffset : document.compatMode === "BackCompat" && document.body.scrollTop|| document.documentElement.scrollTop ;
    }    

    function bindEvent(event, func) {
        if (window.addEventListener) {
            window.addEventListener(event, func, false);
        } else if (window.attachEvent) {
            window.attachEvent('on' + event, func);
        }
    }

  
   	bindEvent('scroll',function() { el.style.display = getScrollTop() >0 ? 'block':'none';});
})();